import React from 'react';
import { Project } from '../components/Project';

const projects = [
    { name: 'Project 1', githubUrl: '', deployedUrl: '', imgUrl: '' },
    { name: 'Project 2', githubUrl: '', deployedUrl: '', imgUrl: '' },
    { name: 'Project 3', githubUrl: '', deployedUrl: '', imgUrl: '' },
    { name: 'Project 4', githubUrl: '', deployedUrl: '', imgUrl: '' },
]

export function Portfolio() {
    return (
        <>
            <h2>Portfolio</h2>
            {projects.map(({ name }) => {
                return <Project name={name} />
            })}
        </>
    );
}
